package com.MITProjectService.bot.domain;import jakarta.persistence.*;import lombok.Data;@Data@Entity@Table(name = "service_category")public class ServiceCategory {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "id")    private Long id;    @Column(name = "categoryName", nullable = false, unique = true)    private String categoryName;    @Column(name = "description")    private String description;    @Column(name = "status")    private int status;}